INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (100, "2024/10/31 12:00:00", 2, "ヤマト", 130011, 0.0, -416.5, "2030/01/01 14:59:59", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 1, 2.1, 3001, 3001100);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (101, "2024/10/31 12:00:00", 2, "ヤマト", 130011, 0.0, -416.5, "2030/01/01 14:59:59", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 4, 5.68, 3001, 3001101);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (102, "2024/10/31 12:00:00", 1, "ヤマト", 130011, 0.0, -416.5, "2030/01/01 14:59:59", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 0.0, 3001, 3001102);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (100, "2024/10/31 12:00:00", 1, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 0.0, 3002, 3002100);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (101, "2024/10/31 12:00:00", 1, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 0.0, 3002, 3002101);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (102, "2024/10/31 12:00:00", 2, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 5, 8.53, 3002, 3002102);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (103, "2024/10/31 12:00:00", 1, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 7, 5.67, 3002, 3002103);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (104, "2024/10/31 12:00:00", 1, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 0.0, 3002, 3002104);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (300, "2024/10/31 12:00:00", 3, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 0.0, 3004, 3002300);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (301, "2024/10/31 12:00:00", 7, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 0.0, 3005, 3002400);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (200, "2024/10/31 12:00:00", 1, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 2, 4.4, 3003, 3003200);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (201, "2024/10/31 12:00:00", 7, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 0.0, 3003, 3003201);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (202, "2024/10/31 12:00:00", 2, "フブキ", 130211, 0.0, -416.5, "2030/01/01 14:59:59", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 1, 5.6, 3003, 3003202);
